import React,{ Component } from 'react'
import { Row,Col,Collapse,Form,Input } from 'antd'
import { connect } from 'react-redux'
import { changeItem } from '../../../store/actions/screen-actions'
import ColorPicker from '../ColorPicker'
const { Panel } = Collapse;
class SettingPropsForm extends Component{
    colorChange = (value,event)=>{
        console.log(value)
    }
    moduleStyleWidthChange = ()=>{

    }
    moduleStyleHeightChange = ()=>{

    }
    moduleStyleXChange = ()=>{

    }
    moduleStyleYChange = ()=>{

    }
    moduleStyleBackgroundChange = (color)=>{
        console.log(color)
        this.props.changeItem({
            style:{
                background:color.hex
            }
        })
    }
    render(){
        // console.log(this.props.type)
        // console.log(this.props.style)
        // console.log(this.props.options)
        return (
            <div className="setting-form-wrap">
                <Form>
                    <Collapse bordered={false}>
                        <Panel header="位置大小" key="1">
                            <Row gutter={10}>
                                <Col span={6}>
                                    <label htmlFor="">大小</label>
                                </Col>
                                <Col span={9}>
                                    <Form.Item>
                                        <Input
                                            suffix="w" 
                                            value={this.props.style.width}
                                            onChange={this.moduleStyleWidthChange}
                                        />
                                    </Form.Item>
                                </Col>
                                <Col span={9}>
                                    <Form.Item>
                                        <Input 
                                            suffix="h" 
                                            value={this.props.style.height}
                                            onChange={this.moduleStyleHeightChange}
                                        />
                                    </Form.Item>
                                </Col>
                            </Row>
                            <Row gutter={10}>
                                <Col span={6}>
                                    <label htmlFor="">位置</label>
                                </Col>
                                <Col span={9}>
                                    <Form.Item>
                                        <Input 
                                            suffix="x" 
                                            value={this.props.style.x}
                                            onChange={this.moduleStyleXChange}
                                        />
                                    </Form.Item>
                                </Col>
                                <Col span={9}>
                                    <Form.Item>
                                        <Input 
                                            suffix="y" 
                                            value={this.props.style.y}
                                            onChange={this.moduleStyleYChange}
                                        />
                                    </Form.Item>
                                </Col>
                            </Row>
                            <Row gutter={10}>
                                <Col span={6}>
                                    <label htmlFor="">背景色</label>
                                </Col>
                                <Col span={18}>
                                    <ColorPicker 
                                        value={this.props.style.background}
                                        onChange={this.moduleStyleBackgroundChange}
                                    />
                                </Col>
                            </Row>
                        </Panel>
                        <Panel header="标题" key="2">
                            <div style={{color:"#fff"}}>标题</div>
                        </Panel>
                        <Panel header="图例" key="3">
                            <div style={{color:"#fff"}}>图例</div>
                        </Panel>
                        <Panel header="折线图样式" key="4">
                            <div style={{color:"#fff"}}>折线图样式</div>
                        </Panel>
                        <Panel header="X轴" key="5">
                            <div style={{color:"#fff"}}>X轴</div>
                        </Panel>
                        <Panel header="Y轴" key="6">
                            <div style={{color:"#fff"}}>Y轴</div>
                        </Panel>
                        <Panel header="数据系列" key="7">
                            <div style={{color:"#fff"}}>数据系列</div>
                        </Panel>
                    </Collapse>
                </Form>
            </div>
        )
    }
}
const mapStateToProps = (state,ownProps)=>{
    return {

    }
}
const mapDispatchToProps = dispatch=>{
    return {
        changeItem(data){
            const action = changeItem(data)
            dispatch(action)
        }
    }
}
export default connect(mapStateToProps,mapDispatchToProps)(SettingPropsForm)
